import React from 'react';
import './AdminMain.css';
import NavBar from '../NavBar';
import BgGlitch from '../BgGlitch';

const AdminMain = () => {
	return (
		<div className="AdminMain">
			<div className="AdminMain_navBar">
				<NavBar />
			</div>
			<div className="AdminMain_BgGlitch">
				<BgGlitch glitch="AdminPanel"/>
			</div>
			<div className="AdminMain_input_container">
				<div className="AdminMain_container_button">
					<button className="AdminMain_button" >
						Connexion
					</button>
					<button className="AdminMain_button">
						S'inscrire
					</button>
						<button className="AdminMain_button_skip">Passer</button>
				</div>
			</div>
		</div>

	);
}

export default AdminMain;
